import React from 'react';
import logo from './logo.svg';
import './App.css';
import ToDoList from './components/ToDoList';
import ToDoListItem from './components/ToDoListItem';

function App() {
  return (
    <div className="App" class="jumbotron">
      <p>Hello World</p>
      <ToDoList></ToDoList>
      <ToDoListItem></ToDoListItem>
    </div>
  );
}

export default App;
